function getClasses(n,t){"use strict";var i=[];return $.get({url:"http://localhost:8000/api/classes/range/"+(n.format("YYYY-MM-DD")+"/"+t.format("YYYY-MM-DD")),async:!1,success:function(n){for(var u,t=0,r=n;t<r.length;t++)u=r[t],i.push(u)},error:function(){return!0}}),i}function eventClicked(){"use strict";$.get({url:"http://localhost:8000/api/users/current",async:!0,success:function(n){var i="";for(var t in n)n.hasOwnProperty(t)&&(i+=t+": "+n[t]+"\n");alert("Current user:\n"+i)}})}function classToEvent(n){"use strict";return{title:n.subjectName+": "+n.type,start:n.dateTime,end:moment.utc(n.dateTime).add(1,"hours").add(20,"minutes").format()}}$(document).ready(function(){var n=getClasses(moment().startOf("week"),moment().endOf("week")),t=n.map(classToEvent);$("#calendar").fullCalendar({allDaySlot:!1,defaultView:"agendaWeek",eventClick:eventClicked,eventColor:"#0275D8",events:t,weekends:!1,weekNumbers:!0})});